原本係強國流行語「社會我X哥」，大致嘅意思係啲人話自己出嚟行嘅吃得開咁解，個出處好柒好夾硬好大陸我諗冇人想知，後來啲愛國盲毛小粉紅就改成「社會主義我X哥」。咁點解蓮十會畀人咁叫，都應該係笑佢年紀輕輕串串貢，就算同先輩講嘢都成日唔用敬語冇大冇細咁。<br />
<br />
不過一陣又話人「社會主義我蓮哥」，轉頭又叫人 「蓮糖」，都幾精神分裂&hellip;&hellip;

